What we've seen so far are rvalues and lvalues . Both are these come from pre C++11 and the names originate from the idea than a lvalue can go on the left side of the equals sign and rvalues may only go on the right side. A little better criteria is that a lvalue is something you can take an address of and a rvalue you cannot. Another possible distinction is that rvalues are temporary values while lvalues are named values. int age = 5;
Person p = Person("Bob", 20);
int ageBob = p.getAge();
long long bigAge = age; Here, age, p, ageBob, and bigAge are lvalues. 5, the result of the Person constructor, and the temporary result of p.getAge() are all rvalues. Once again, you can think of rvalues as temporary values. We can't take the address of the result of the Person constructor, 5, nor the result of p.getAge(). Although we can do this: int foo();
&foo; // adress of foo
// not the address of the result of calling foo int * resPtr = &(foo()); // error
// return from function is not an lvalue Although we cannot have pointers to rvalues, we can have references to rvalues. Lvalue references are denoted with & and rvalue references are denoted with &&. Now confusingly, the rvalue reference itself is a lvalue. This lvalue just so happens to store a reference to a rvalue. Using rvalue references, we can avoid an excess construction when using rvalues. auto makePerson() { return Person();
} auto funcL(const Person & p) { } auto funcR(Person && p) { } Person p; funcL(p); // no construction
funcR(p); // error, p is not an rvalue
funcL(makePerson()); // construct a new Person from the temporary return, pass the reference of this new Person to funcL
funcR(makePerson()); // no construction As you may notice, this && syntax is exactly what we use in the move constructor. As a rvalue reference indicates a temporary or value we don't care about, this means that when passed to a move constructor, we're allowing that constructor to steal the rvalues internals and leave behind a "shell" of an object. In order to move, we need a non-const rvalue reference (otherwise we couldn't modify the old value to invalidate it, and we'd effectively perform a copy). Thus, since rvalue references are primarily used for moving, we don't often use const rvalue references. This is because, if we tried to move construct from a const rvalue reference, the compiler would silently perform a copy since a const && cannot bind to && but it can bind to const & (copy constructor!). Person getPerson() { Person newPerson; //... return newPerson;
} // accepts an rvalue reference!
void doStuff(Person && p) { std::cout << p.getName() << "\n";
} void doStuff2(const Person & p) {} doStuff(getPerson());
doStuff2(getPerson()); // construct Person from return of getPerson doStuff(Person("Joe", 10));
doStuff2(Person("Joe", 10)); // construct another Person from constructed person doStuff(std::move(lvaluePerson));
lvaluePerson.getName(); // BAD, lvaluePerson has been moved
// internals could be empty Notice getPerson() doesn't return a Person&& nor do we explicitly move newPerson, but the resulting behavior is still to move newPerson and bind that temporary to the rvalue reference. It's generally not a good idea to have a return type as a rvalue reference nor should we explicitly return by std::move() because this inhibits some compiler optimizations we'll talk about later. So what's the point of all this? Well, since we are using a reference to an existing object, we don't have to reconstruct the object from the temporary. Furthermore, a rvalue indicates a temporary object. Thus, when we use rvalues we get to assume they the object is being discarded, and we can construct new objects from rvalues very cheaply via swapping. Instead of having to copy the state from the existing object to the new instance, we can sort of just steal the state of the temporary and take ownership of it. After all, a rvalue is just a temporary about to be destroyed. auto sumVec(const std::vector<int> & v) { return std::accumulate(v.begin(), v.end());
} // rvalue overload
auto sumVec(std::vector<int> && v){ std::vector<int> * ptr = &v; // this is valid, so v is an lvalue return sumVec(v); // calls lvalue reference version // since v is an lvalue
}
std::vector<int> * invalid = &std::vector<int>({20, 30, 40, 560}); // error! not an lvalue const auto sum = sumVec({20, 30, 40, 560}); // bind to rvalue overload
// the vector is constructed once, that single object is passed by reference to both functions std::vector vec = {1, 2, 3, 4}; const auto sum2 = sumVec(vec); // calls lvalue overload
// again vector is constructed once (at its definition) Later we'll see how universal references (aka forwarding references) can be used to have one function for both lvalues and rvalues. For now, a good method (and sometimes preferable to forwarding references) to get the best of both worlds is to create two functions and implement the rvalue reference overload in terms of the lvalue one. Now since a rvalue reference argument is a lvalue, if we want to pass it to another function taking a rvalue reference we'd have to use std::move. auto func1(Car && car) { //...
} auto func2(float mpg, Car && car) { // .. return func1(std::move(car)); // cannot use car after this line // totally fine since that's the last line // in the function
} func2(30.3, {"Tesla", "Model S"});
// A Car is constructed once, a reference to that is passed to func2
// then that same car is moved to func1

