A prvalue is the result of the construction of an object including functions returning non-references, literals (except string literals), enumerators, lambda expressions, pending member function calls, and the this pointer. Roughly speaking it is a direct value. A prvalue cannot be polymorphic so its static type must be the same as its dynamic type. Person("Jimmy", "Longbottom"); // prvalue
{20, 30, 40}; // consruct an std::initializer_list<int>
std::string("Hello World"); // prvalue "Hiya"; //not prvalue str1 + str2; // operator+ constructs a new string, that result is a prvalue 42 // literals are prvalues struct Person { enum { brown, black, blonde, red, ginger } hairColor; auto guessEyeColorFromHairColor() { switch (hairColor) { // ... } }
} Person::ginger; // prvalue, since enumerators are prvalues Person p; p.guessEyeColorFromHairColor; // pending member function call
// prvalue
// cannot do anything with this except call it
// cannot take reference of this // as a reminder, here is the member function pointer syntax
HairColor(Person::* memberPtr)(void) = &Person::guessEyeColorFromHairColor;
(p.*memberPtr)(); // call it with p as the context object // But
