Glvalues are "generalized lvalues" and are composed of lvalues and xvalues. They can be polymorphic (actual type is not the static type) and have an incomplete type. When a glvalue appears where an prvalue is expected, the glvalue is converted to a prvalue. Let's look at an example to recap: class Game { std::string name;
public: Game(std::string some_name) : name(std::move(some_name) /*xvalue*/) {} std::string& getName() { return name; } std::string cpyName() const { return name; }
}; Game g("Skyrim"); g; // lvalue g.getName(); // lvalue
g.cpyName(); //prvalue

