Now I said it's generally not a good idea to return by rvalue references, yet I also said that the result of a function that returns by rvalue reference is an xvalue. So clearly, returning by rvalue references has its uses. And yes, yes it does but its usage is somewhat esoteric. Take the following code snippet: class MaybeResult { ResultType result; bool success;
public: MaybeResult() : success(false) {} MaybeResult(const ResultType & res) : result(res), success(true) {} ? valueOrThrow() { // just for fun: this concept is called a Monad and this particular function is often named unwrap() if (success) return result; throw std::runtime_error("No value stored in result"); }
}; MaybeResult doComputation() { // ... return MaybeResult(computation);
} auto res = doComputation().valueOrThrow(); Now, how can we avoid copying result. Perhaps ResultType is a large matrix, it would be great not to copy it. But if we return by reference, then the reference will dangle since result is a member of a temporary. What if we could move result? Well, that would be lovely but then valueOrThrow would be unsafe to call on a lvalue! Thankfully, we can use ref-qualifiers to constrain the type of value the member function is applied on. Ref-qualifiers work exactly like declaring a function const. In truth, both qualifiers aren't properties of the function but rather constraints on the type of the implicit first argument this pointer. For example, a free function version of valueOrThrow could be: ResultType&& valueOrThrow(MaybeResult && maybe) { if (maybe.success) return std::move(maybe.result); else //...
} ResultType& valueOrThrow(MaybeResult & maybe) { if (maybe.success) return maybe.result; else //...
} const ResultType& valueOrThrow(const MaybeResult & maybe) { if (maybe.success) return maybe.result; else //...
} The analogous member functions using ref-qualifiers would therefore be: //... // called on rvalues ResultType&& valueOrThrow() && { if (success) return std::move(result); else //... } // when valueOrThrow() is called on lvalues ResultType& valueOrThrow() & { if (success) result; else //... } // when called on const lvalues const ResultType& valueOrThrow() const & { if (success) return result; else //... }
};
auto res = doComputation().valueOrThrow(); // #1
MaybeResult res2; res2.valueOrThrow(); // #2 const auto res3 = doComputation(); res3.valueOrThrow(); // #3

