Firstly, definitions are declarations that fully define something except for the following cases (and a few more): Function declaration without a body Declaration with extern that lacks an initial value extern const int i; // declaration
extern const int j = 5; // definition Non-inline static members in a class struct S { int i; // definition static int j; // declaration inline static int k; // definition
}; int S::j; // definition Declaration of class without body class S;
class ReturnType func(class ArgType a); Using and typedef aliases Template parameters template<typename T> //T is declared Now as the name implies, only one definition of something is allowed in a single translation unit, and one and only one definition of non-inline functions and variables must exist in a program. Finally, one definition of inline functions and variables must be present in every translation unit where they are ODR-used. Functions are ODR used when somebody makes a call to it or takes its address. Objects are ODR used when its value is read (unless it's a compile-time constant), written, has its address taken, or a reference is bound to it. For a reference, it is ODR used when it is not known at compile time. Anything that's ODR used must have a valid definition somewhere in the program. This was a pretty round about way of basically saying that templates are normally defined in header files and nothing else can be defined in a header file unless it's inline or a non-static member variable.

