using stack_t = LList<T>; stack_t<int> stack; class Test { using name_t = std::string; name_t name;
public: using test_t = int; name_t getName() const { return stack; }
}; Test::name_t nm; // error, not visible
Test::test_t tt; // good template<typename T>
using tuple_3 = std::tuple<T, T, T>; tuple_3<int> tp;
