There's one type of reference we haven't looked at yet. And that's the universal, aka forwarding, reference. It's not exactly its own type of reference, but rather it can bind to both rvalues and lvalues and is formed like T&& where T is some template parameter. A universal reference cannot have qualifiers or other type adornments. For example const T&& is a const rvalue reference to T and not a const universal reference. For example, the following are rvalue references, not universal references: const T&& std::vector<T>&& volatile T&& T*&& We can use universal references to create a function which works for both rvalue and lvalue references. This is possible with the help of std::forward<T>. std::forward is similar to std::move except std::forward conditionally casts the argument to T&& while move always casts its argument to T&&. std::forward will cast its argument to T&& if it's a rvalue reference otherwise it keeps it as a lvalue reference. This allows function that use a forwarding reference to take advantage of move semantics when they can. template<typename T>
struct Node { T data; std::unique_ptr<Node<T>> next; explicit Node(T&& data) : data(std::forward<T>(data)), next(nullptr) {}
} auto n = Node<std::string>("Hello World");
// const char * is passed by lvalue reference to Node(T&&)
// const char * used to construct std::string auto n2 = Node<std::string>(n.data);
// lvalue reference passed to Node(T&&)
// copy constructor used to copy data auto n3 = Node<std::string>(std::move(n2.data));
// rvalue references passed to Node(T&&)
// n3.data is move constructed from n2.data auto getString() { return std::string("Hiya");
} auto n4 = Node<std::string>(getString());
