As we've seen with std::void_t, emplace(), and make_unique/make_shared, there is a way to take an unknown amount of parameters of different types. This can be done using a parameter pack . A template that uses a parameter pack is known as a variadic template. You can almost think of a parameter pack as a list of template parameters (both type and non-type parameters). A parameter pack can have any number of parameters, including none. template<typename ...Ts>
struct Types {}; Types<> t;
Types<1, 2, 3> t2;
Types<int, short, std::string, char> t3; template<typename ...Ts>
void func(Ts... args) { // ..
} func();
func(100, "Hello", 'g'); We can define a parameter pack by putting the ellipsis in front of the pack name, and expand a parameter pack by putting the ellipsis after the pattern . The pattern is the pack name with any adornments (such as &) which are given to all elements of the pack. During expansion, the pattern is substituted by the elements of the pack separated by commas. template<class ...Us> void f(Us... pargs) {} template<class ...Ts> void g(Ts... args) { return f(&args...); // calls f by passing all elements of args by reference // &args is the pattern
}
g(1, 0.2, "a"); We can expand parameter packs in the following contexts: As we've just seen, function arguments template<typename ... Ts>
void g(Ts... args) { f(args...); f(++args...); // expands to f(++a, ++b, ++c, ...) f(h(args...) + args...); // expands to //f(h(a, b, c) + a, h(a, b, c) + b, h(a, b, c) + c);
} Initializers (both parenthesis and braces) template<typename ... Ts>
auto toVec(Ts ... args) { std::vector v = {1, args..., 2}; return v;
} Template arguments template<typename ... Ts>
struct Test { container<int, short, Ts...> c;
}; Base class specifiers and member initialization lists template<typename ... Mixins>
struct Aggregator : public Mixins ... { Aggregator(const Mixins& ... args) : Mixins(args) ... {}; // expands to call copy constructor of all base classes
} Using declarations template<typename ... Mixins>
struct Aggregator : public Mixins ... { Aggregator(const Mixins& ... args) : Mixins(args) ... {}; // expands to call copy constructor of all base classes void foo() {}; using Mixins::foo...; // unshadow all base class foo overloads
} Parameter packs can also be universal references and can be forwarded. template<typename T, typename ... Args>
auto make_unique(Args&& ... args) { return std::unique_ptr<T>( new T(std::forward<Args>(args)...) ); // expands to // new T(std::forward<A>(a), std::forward<B>(b), std::forward<C>(c), /* ... */)
} Basically, each use case of ... expands a comma separated list of the pattern ... is applied to. The name of the pack typename (Args in this case) is substituted which each type in the pack, and the name of the pack arguments (args here) is substituted with each argument passed to the function. We can "unpack" an expansion by using two function overloads (or class specializations), one which takes no arguments, this will be the base case, and one which takes a "head" argument and "tail" parameter pack. The idea here is the same as in functional programming. Here's a simple function to get the length of a parameter pack. constexpr auto argCount() { return 0;
} template<typename T, typename ... Args>
constexpr auto argCount(T&&, Args&& ... args) { return 1 + argCount(std::forward<Args>(args)...);
} constexpr auto count = argCount(5); static_assert(count == 1);
static_assert(argCount("Hello", 50.0, 10, 'c') == 4); When we call argCount with non-zero amount of arguments, the first argument gets bound to T&& and the rest (which there may be none) gets bound to Args&&. If the pack has no arguments in it, the expansion won't do anything, and the no parameter overload will be called. A better way to do this is to use the sizeof... operator, which gets the amount of arguments in a parameter pack. template<typneame ... Args>
constexpr auto argCount(Args&& ...) { return sizeof...(Args); // sizeof... takes the typename of the pack, not the argument name
} Here's an example of getting the nth type from a parameter pack: template<unsigned index, typename Head, typename ... List>
struct NthType { using Type = typename NthType<index - 1, List...>::Type; // we "pop" the Head of the pack by not passing it through
}; template<typename Head, typename ... List>
struct NthType<0, Head, List...> { using Type = Head;
};
