A fold expression is like another type of pack expansion, except that instead of producing comma separated arguments, the pack is expanded over a binary operator. A fold expression can have an initial value as well, and must be surrounded by parentheses. I won't explain the details of folds here, but basically left folds operate on the leftmost argument first, right folds go from the rightmost argument to leftmost. Folds come from functional programming languages. Fold expression have the following syntax where pack is the pattern containing the name of the pack, op is the operator, init is the initial value and ... are the actual ellipsis. Unary fold right - (pack op ...) Unary fold left - (... op pack) Binary fold right - (pack op ... op init) Binary fold left - (init op ... op pack) The difference between a unary and binary fold is not that one uses unary operators (that would be a normal pack expansion), but rather the binary fold has an initial value. The syntax for a left fold is when the ... is on the left side of the pack name. template<typename ... Ts>
constexpr auto sum(Ts&& ... args) { return (... + args); // "unary" left fold
} template<typename ... Args>
void print(Args&& ... args) { (std::cout << ... << args); // binary left fold
} template<typename ... Args>
constexpr auto allTrue(Args&& ... args) { return (... && args); // binary left fold
} template<typename T, typename ...Args>
constexpr auto contains(T needle, Args ... args) { // true if needle is contained within the pack return (... || (args == needle));
} template<typename ...Args>
constexpr auto selfDot(Args... args) { // computes the dot product of the arguments with them self return (... + (args * args));
} Notice the need for the parenthesis to make an entire expression such as args * args or args == needle part of the pattern. We define all of these function constexpr so that the result of the function can be available at compile time (and therefore not done during runtime) if we pass arguments that are also constexpr such as literals.

