|
|_ Contiguous Iterator | |_ Random Access | |_ Bidirectional | |_ Forward | |_ Input | |_ Output Each iterator has a corresponding iterator tag type that would be assigned to the iterator_category type alias. The tags are std::input_iterator_tag, std::output_iterator_tag, etc. The STL provides some general methods for operating with iterators that are specialized to use more efficient operations if available. std::advance(it, diff) takes an iterator reference as its first parameter and a different type as its second parameter. It will advance the iterator diff spaces using operator+ if it's available otherwise will repeatedly increment the iterator. std::distance() will return the distance between two iterators. Similarly, std::distance will be constant time for iterators that support operator-(iter, iter). The STL also provides std::next and std::prev which are similar to std::advance for incrementing and decrementing the iterator. When designing generic code, it's best to be as generic as possible . For example, if you're using iterators in a for loop, it's better to use operator!= rather than operator< for comparing the iterator to the sentinel because only Random Access and Contiguous iterators support operator<. This doesn't just apply to iterators. Any time you use a type parameter you ideally want to use the most broadly applicable interface possible to reduce the requirements for that type. Consider: // Needs a random access iterator and a container with a size member and operator[]
template<typename T>
