Taking the term from Andrei Alexandrescu, a policy is a small little class which handles a single behavior or structural element for larger, more complex classes. Policy Based Design is the methodology to design classes by using such policies. Policy based design is sort of like the generic programming equivalent of object composition with class hierarchies. Let's look at an OOP and generic way of abstracting the thread safety and comparator behavior of a Linked List: // OOP object composition (untested)
class ThreadingPolicy {
public: virtual ~ThreadingPolicy() = default; virtual std::unique_ptr<LockProxy> lock() = 0; struct LockProxy { virtual ~LockProxy() = default; };
}; class MultithreadedPolicy : public ThreadingPolicy { std::mutex mu;
public: class MTLock : public ThreadingPolicy::LockProxy { std::mutex &mu; public: MTLock(std::mutex& mu) : mu(mu) { mu.lock(); } ~MTLock() { mu.unlock(); } }; std::unique_ptr<LockProxy> lock() override { return std::make_unique<MTLock>(mu); }
}; class SingleThreadedPolicy : public ThreadingPolicy {
public: struct SSLock : public ThreadingPolicy::LockProxy {}; std::unique_ptr<LockProxy> lock() override { return std::make_unique<SSLock>(); }
}; struct Comparator { virtual ~Comparator() = default; virtual int compare(int, int) = 0;
}; struct LessThanComparison : Comparator { int compare(int a, int b) override { return a - b; }
}; class LinkedList { std::unique_ptr<ThreadingPolicy> tp; std::unique_ptr<Comparator> cmp; struct node { int data; std::unique_ptr<node> next; node(int data) : data(data), next(nullptr) {} }; std::unique_ptr<node> root;
