You've likely seen lambdas in other programming languages, so I'll just get into the C++ specifics. Lambdas have the syntax: []() { } Where [] contains the variables captured by the lambda from the local scope, () encloses the arguments, and {} encloses the code that is part of the lambda. Data that is captured is copied into the lambda's closure which is a runtime object that holds copies or references to captured data and is an instance of the closure class that the lambda belongs to. We can think of a lambda as being syntactic sugar for the compiler creating a class which provides an operator(), and instantiating that class like so: class ClosureClass { int myCapture;
public: ClosureClass(int myCapture) : myCapture(myCapture) {}; // think of lambda capture as constructing a member in the closure class bool operator()(int myArgument) { return myArgument > myCapture; }
}; ClosureClass closure(10);
const auto test = closure(20); // Lambda version: int myCapture = 10;
const auto lambda = [myCapture](auto arg) { return arg > myCapture;
}; const auto test = lambda(20); Unlike functions, the arguments in lambdas can be auto, leaving the compiler to deduce their type using the same method it uses to deduce template types. The return type is automatically deduced, however it can be manually specified with a trailing return type. int capture = 10;
const auto lambda2 = [capture](int arg) -> bool { return arg > capture;
}; The variables captured by a lambda are, by default, copied unless you manually request a reference by prepending the variable name with &. The captured variables are captured once, when the lambda is defined. Even though the variables are copied, they are immutable unless you make the lambda a mutable lambda, which allows the closure to modify the members of the closure class. int cap = 30;
const auto l2 = [cap]() mutable { return --cap; // although cap is copied, it cannot be mutated from within the lambda // unless you declare the lambda mutable
}; l2();
l2();
const auto r = l2();
// r is 27 cap; // 30 const auto l3 = [&cap]() { cap = 20; // fine because the closure class member (the reference) // isn't changing but the data it refers to is
}; l3(); cap; // 20 A better way to capture variables is by init-capture . This method allows you to move variables into the closure along with making it very clear how each variable is captured. It uses the syntax <name> = <expression> where <name> is the name of the variable within the closure that will store the result of <expression>. This variable is created by move or copy constructing a new instance of the result of <expression>. std::unique_ptr<Person> pp;
int num = 0;
Person p; const auto l4 = [person1 = std::move(pp), num = num, person2 = &p] { num; // copied person1; // move constructed from pp person2; // pointer to p
}; If we wanted a reference instead of a pointer, we can wrap the data in a std::reference_wrapper<T> using std::ref. A std::reference_wrapper provided value semantics (is copyable) for a reference. It is implicitly converted to a T reference, or explicitly with its member function get(). It also provides operator() so that if it holds a reference to a callable object, it can directly invoke that callable object without unwrapping it. If we wanted a const reference we can create one with std::cref. This is needed because passing a lvalue reference will invoke the copy constructor, and rvalue references will invoke the move constructor. Therefore, we wrap the reference in a reference_wrapper which avoids constructing a new instance of the underlying data and instead will construct a new instance of std::reference_wrapper. const auto l5 = [person3 = std::ref(p)] { person3.get().speak(); const auto name = person3.get().name; // person3 is a std::reference_wrapper<Person> not a Person& person3.get() = Person();
}; std::reference_wrapper<T> is also useful to allow containers such as std::vector that cannot hold references to be able to do so. However std::reference_wrapper, is just, well a reference_wrapper and provides no mechanisms to prevent or check for dangling references. In terms of safety, it's not much better than having a container of raw pointers. std::vector<std::reference_wrapper<int>> nums; int myNum = 10;
nums.emplace_back(myNum); // emplace forwards arguments to constructor // in this case passing an lvalue reference to constructor
// myNum must live at least as long as its reference held in nums nums.back() = 20; myNum; //20 Back to lambdas: there are limitations to what can be captured. Static variables cannot be captured and neither can member variables. Static variables can be accessed from within a lambda without capturing them, and member variables can be accessed by copying the pointer of the owning instance object. This means that in both of these cases, the value of the variable will be what the value is at the time the lambda is invoked, and not at the time the lambda is defined. This is opposite the normal behavior! Variables in a lambda can be captured by a default capture mode [&] or [=]. Default capture modes capture all used variables by reference or by value, respectively. You should prefer init capture or enumerating the variables you capture instead of using default capture modes. The reason is that default captures make it harder to reason about object lifetimes and realize when certain variables cannot be captured. Consider we use the default reference capture mode to pass everything by reference. You must take care to ensure that the objects you capture outlives the lambda. Lambdas are very easy to bring out of the scope they were declared in (say, adding it to a vector) and thus anything that is captured must live outside the initial scope as well. To avoid this, you might be tempted to just copy all variables you use with the default copy capture mode. But the capture mode [=] to capture by copy doesn't always copy everything you "capture". Remember, when you capture member variables you aren't actually copying them. You are copying the this pointer to the owning object. Thus, the default "pass by value" capture is susceptible to the same dangling pointer problem as passing by reference. Furthermore, using the default copy capture mode might make you think a static variable's value was saved in the closure, however no copy was actually made and any outside code that mutates the static variable also affects the lambda! A static variable "captured" by a default capture mode isn't really captured, as the code will simply refer to the single instance of the static variable that exists outside the scope of the lambda. Therefore, a default capture by value isn't actually capturing everything by value. This confusion can be avoided by using init-capture . class Foo {
private: int data; Person person;
//... // in some member function: // bringing the lambda out of the function scope callbacks.push_back([=]() { return data * 5; // data is not copied // the this pointer is // if this lambda outlives the owning // instance of Foo // we'll have a dangling pointer! }); // This is what's really happening: callbacks.push_back([ptr = this]() { return ptr->data * 5; }); SomeClass c; auto p = [=, &c]() { // "everything" captured by value except c }; // Init capture examples: [person = std::move(person), c2 = &c]() { // Foo::person is moved to a variable person // in the closure // c is passed by pointer to a variable c2 // in the closure } } The closure class's operator() is by default const. So mutating a captured variable requires declaring your lambda mutable.

