* Creates a new container containing only the elements that fell in line
* Order is determined by the function f, which returns true if the first argument should come
* before the second
*/
template<class Container, typename Element>
auto stalinSort(const Container& container, std::function<bool(const Element&, const Element&)> f) -> std::enable_if_t<std::is_same_v< typename std::iterator_traits<decltype(std::declval<Container>().begin())>::value_type, Element >, Container>
{ Container result; if (container.empty()) return result; auto it = container.begin(); result.push_back(*it); it = std::next(it); auto last = result.begin(); for (; it != container.end(); ++it) { if (f(*last, *it)) { result.push_back(*it); // ++last; BAD // we cannot just increment last // because the container might move // if it needs to reallocate. If this happens // last will become invalid last = result.begin(); std::advance(last, result.size() - 1); } } return result; } std::vector nums = { 10, 400, 20, 30, 60, 708, -100, 1000 };
