Generally, lambdas should be preferred to bind, but I do feel it is good to know about. Bind can be used to partially apply a callable object. Partial application is when you supply some, but not all the arguments to a function. The returned object of a partial application is another callable objects that takes the unspecified arguments. std::bind takes a callable object, and constructs a bind object from it by copying in the arguments passed to std::bind. The bind object works similarly to a closure. However, its operator() can only delegate to the callable object that was passed to std::bind. The first argument of std::bind is the callable object, if the callable object is a member function then the second argument is a pointer to the owning instance (or a placeholder). Remember, this owning object pointer can really be viewed as the first argument to the function. The rest of the arguments are placeholders or parameters bound to the underlying function arguments based on position. The arguments passed to std::bind are constructed in the bind object. Thus, lvalues are copied into the bind object and rvalues are moved. Furthermore, we can use std::placeholders to map arguments of the bind object's operator() to arguments in the underlying callable object. Each placeholder has a number that corresponds to the argument index during invocation of the bind object. This is best explained with an example: class Bar {
public: void memberFunction(int a, double & b, char c) { }
}
