An optional is a type that may contain a value. It's especially useful for returning something from a function that can fail. If an optional contains a value, that value is part of the optional's memory layout. That is to say the value it contains is not dynamically allocated. If the optional does not contain a value, that value has yet to be constructed and there is no memory reserved for it. Therefore, an optional provides practically no overhead to code that uses them regardless if they are empty or not. An optional's has_value() member can be used to query if the optional contains a value, the optional is also convertible to bool. It has a default constructor that creates an empty optional, and an implicit conversion constructor to convert wrap an object of the contained type into a filled optional. We can use operator*, operator->, or the value() members to get access to the contained value of the optional. If the optional does not contain a value when one of these members are called, it throws std::bad_optional_access. Remember that dereferencing a nullptr is undefined behavior, however optionals provides a defined result when getting the data of an empty one. auto opt = std::make_optional(100);
