The Variant is a type safe union. It can hold one of the multiple types specified as template arguments. A possible usage of a variant is to return either an error message, or a result from a function. Like an optional, the variant's data is held directly within the variant so no dynamic allocation. Furthermore, it does not hold extra data besides the value that is currently stored within it. We can use std::get to get the specified type or index of the variant. If the variant does indeed hold that type, the value is returned. Otherwise, the exception std::bad_variant_access is thrown. Once again this requires us to know the type or index of the type we want at compile time. We can use the std::holds_alternative<T> function to check if the variant holds a value of type T. std::variant<int, char, std::string> var = 'H'; if (std::holds_alternative<std::string>(var)) { // .. do something with the string
