} There is also the std::get_if<T> function which takes a pointer to a variant and returns a pointer to T if the variant contains T. Otherwise, the function returns nullptr. std::variant<Data, std::string> readData(std::string_view s) { std::ifstream stream(s.data(), std::ios::binary); if (stream.is_open()) { try { Data d; stream.read(reinterpret_cast<char*>(&d), sizeof(Data)); return d; } catch (const std::exception & e) { return e.what(); } catch (...) { return "An unknown error occurred while reading file"; } } return "Could not open file";
} auto v = readData("data.bin");
if (auto ptr = std::get_if<Data>(&v); ptr) { Data cpy = *ptr; // ...
} else { std::cerr << "An error has ocurred: " << std::get<std::string>(v) << std::endl;
} Another way to determine what a variant holds besides std::get_if is the member function index() which returns the index of the currently held value's type. std::variant<std::string, std::vector<char>, std::vector<unsigned char>> bytes; if(bytes.index() == 1) { //do something with std::vector<char>
} if(std::holds_alternative<std::string>(bytes)){ auto str = std::get<std::string>(bytes); if(!str.empty()){ bytes.emplace(std::vector{str[0]}); // constructs a new value in-place }
} As shown in the example, variants also define the emplace() member function for constructing a value directly in the variant. We can use std::visit to perform a function templated on the type the variant holds. Using constexpr if we can perform a different action based on what the variant holds. Constexpr if is an if statement that is evaluated at compile time. Thus, when using constexpr if, the compiler can determine which branch is taken and inline that choice directly in the code. This makes it look like there wasn't a conditional to begin with if you were to look at the compiled code. std::variant<char, int, double> getGpa(); auto variant = getGpa();
