}); std::vector<char> letters;
std::generate_n(std::back_inserter(letters), 100, [](){ return 'A'; });
letters.size(); //100 std::transform(begin, end, [optional 2nd range begin], dstBegin, func) - analogous to map, and zip Iterates through a range or two, calls the function and stores the result of that function in the destination range The second range must be at least as large as the first Func takes in the underlying value of the iterator from the first range as the first argument, and if a second range is specified, the value of the second second as the second argument std::vector a = {100, 200, 300};
