// then different sizes passed to Int2Type<> instantiate different Int2Type types void doFoo(Int2Type<4>);
void doFoo(Int2Type<2>);
void doFoo(Int2Type<1>); doFoo(Int2Type<sizeof(int)>{});
// correct overload is called and inlined into the compiled code by the compiler. We've seen how we can do something similar with constexpr if and template specialization. Tag dispatch is just another tool in the toolbox that you may find optimal for some problems.

