A dependent name is essentially a name that relies on a template argument to get resolved. Basically these are the members of a template type or template type argument. By default, the compiler interprets dependent names as values, which is why we needed the typename keyword when accessing a member type alias. template<typename T>
using type = MyVec<T>::type;
// Compiler has no idea what `type` is
// by default it assumes it's some value
// which is why we need to add `typename` The compiler could wait until the template is instantiated before checking this, however many compilers don't in order to give the error to the author of the code and not an unsuspecting client. Consider the following: T::doSomething<int()>(5); The compiler could interpret this three ways: Call a function doSomething that takes a type argument which is a callable object that accepts no parameters and returns int and pass that function 5 Instantiate a template type T::doSomething with the template argument int() (type of parameter-less callable object returning int) and initialize it with 5. Call operator< on a value T::doSomething with the no-parameter initializer for type int (which is 0) and then check if the integral value of the resulting boolean is greater than 5. We can tell the compiler to use option 2 with the typename keyword, and option 1 with the template keyword. T::template doSomething<int()>(5); // #1
typename T::doSomething<int()>{5}; // #2
T::doSomething < int() > (5); // #3 Generally speaking, use typename to access a type alias of a template type, and use template to call a template method of a template type. template can also be used after . and -> too. For more information, take a look at Modern C++ Design by Andrei Alexandrescu.

