Let's create a class zip, that can be constructed from an arbitrary amount of different containers. The definition for our container concept is just a type that contains a semantically correct begin() and end() method. Because I'm being a tad lazy, I'm going to forego the SFINAE enforcement of this concept. zip will simply have begin() and end() methods that return a forward iterator that iterates over all the containers at once. "De-referencing" this iterator will return a tuple of the values of de-referencing iterators to all the containers. The iterator will just be a forward iterator, and iteration will continue until the smallest container has been completely iterated through. Let's start with the zip class which will be pretty simple. We'll store a tuple of references to containers. We must use a tuple so that we can have an unknown amount of members of different types. template<typename ... Containers>
class zip { std::tuple<Containers&...> containers;
public: zip(Containers& ... containers) : containers(std::tie(containers...)) {} class iterator; iterator begin() { return iterator(containers); } iterator end() { return iterator(); } const iterator begin() const { return iterator(containers); } const iterator end() const { return iterator(); }
}; std::tie creates a tuple of lvalue references; no constructor is called for any of the tuple elements. std::make_tuple will copy or move construct each element of the tuple. We declare the zip iterator class, which we'll define outside the zip class for neatness. Notice that since zip holds references to containers, it must not outlive any container passed to it. We'll make the iterator's default constructor construct an invalid iterator. The iterator will need access to the zip class containers tuple. template<typename ... Cs>
