public: iterator(const std::tuple<Cs&...> & context) : invalid(false) { std::apply([this](auto& ... containers) { iterators = std::make_tuple(containers.begin()...); ends = std::make_tuple(containers.end()...); }, context); } iterator() : invalid(true) {} //... We'll use an invalid flag to denote an iterator that reached the end of the smallest container. Default constructing the zip iterator will set this flag to true. We'll also store an iterator for each container, and the end iterator for each container. Therefore, we can determine when the zip iterator is done iterating by testing if any of the iterators equals its corresponding end iterator. This is what the is_end_iter method does. If N, the integral template argument is less than the amount of containers we're iterating over, then we check if the Nth iterator equals the Nth sentinel iterator. If it does, we return true. Otherwise, we recurse and test the N + 1 iterator. If N is greater or equal to the amount of containers, then we simply return false, which is the null element for boolean or. That is to say that x == x || false. Let's look at the constructor. We use std::apply to unpack the elements of a tuple into arguments of a variadic lambda. We can then use std::make_tuple and fold expressions to construct a tuple from begin and end iterators. containers are passed by reference to avoid copies. Notice how we capture the this pointer. If you remember, this is because we cannot capture member variables directly, but instead we must capture the this pointer to the object they belong to. std::apply is used because we cannot use a fold expression over template arguments. So the following won't compile: template<typename ... Indicies>
