Store operations can have std::memory_order_relaxed, std::memory_order_release, or std::memory_order_seq_cst. Loads can have std::memory_order_relaxed, std::memory_order_acquire, or std::memory_order_seq_cst. RMW (read-modify-write such as operator++) can have std::memory_order_relaxed, std::memory_order_acquire, std::memory_order_release, std::memory_order_acq_rel, or std::memory_order_seq_cst. seq_cst is the strictest and default order and enforces a total modification order between threads. That means that at the end of the day, there is some concrete order of events taking place that all threads recognize. When an atomic with seq_cst memory ordering is set, all threads see the updated value. You can think of seq_cst memory ordering as enforcing that all threads work off a single memory location. Relaxed memory ordering is the weakest, and it basically allows processors to more or less only work off their local cache and synchronize their cache to main memory when they see fit. During a relaxed load, the only constraint is that a thread will read a value at least as recent as the last value they know about. Consider that thread A stores 23 to variable a and then 100 to b, and then thread B stores 42 to a and then 200 to b. The next time A loads a, it might still be 23. However, it may load b and see the value is 200. In fact, the next 100 times A loads a, it might still only read 23. In thread A's perspective, b was updated to 200 before a was updated to 42. For thread B however, the next time it loads a or b it must get 42 and 200 respectively, because it already knows about these more recent values. Thread B could not load 23 from a after storing 42 to it because it already knows about the more recent modification. In thread B's perspective, a was updated to 42 before b was updated to 200. Exchange operations in a relaxed memory ordering are a little stronger. Extending the cubicle analogy, and exchange would be like telling the man to write down a certain number and give you the last number in the list. An exchange will always read the most recent value available. Similarly, a compare exchange operation would be like telling the man: "I think x is at the bottom of the list, if it is, write down y, otherwise tell me what is at the bottom of the list." std::atomic<bool> x = false, y = false;
std::atomic<int> z = 0;
void write() { x.store(true, std::memory_order_relaxed); y.store(true, std::memory_order_relaxed);
}
