}
void read() { while(!y.load(std::memory_order_acquire)); //wait for y to be true if(x.load(std::memory_order_relaxed)); ++z;
}
int main() { //write() and read() on separated threads /* z can not be 0 this time this is because the load from y synchronizes with the store to y any updates that are sequenced before the store to y become visible to the thread that loads from y Notice how we achieved the same results as seq_cst memory ordering with weaker (and more efficient) memory orderings */
} Acquire/release memory ordering can be thought of like so: Imagine that when we tell the man a value, we also give him a batch number that value is part of and let him know if that update is the last number in the batch. Now when we load values, the man will tell us if the value he gave us was the last number in a batch, and if it is he'll inform us who gave him that batch along with the batch number. Now let's call up a woman in another cubicle playing the same game. This time, we'll ask her for a number and inform her we know about batch number X from caller Z. This time, not only does the woman have to give us a number more recent than the last number we loaded or stored from her, but she also has to give us a number at least as recent as any value in batch X from caller Z. Last thing to mention is something called a release sequence . If you have a release store, acquire load, and a sequence of RMW operations that happen in between the load and store, this forms a release sequence. The RMW operations in between can have any memory ordering and the acquire will still synchronize with the final load. void populate_queue() { //populdate data on queue count.store(numberOfItems - 1, std::memory_order_release);
