template<typename T>
class ThreadQueue { struct node { std::unique_ptr<T> data; ///< Terminal iff data is null std::unique_ptr<node> next; node(std::unique_ptr<T> && data) : data(std::move(data)), next(std::make_unique<node>()) {} node() : data(nullptr), next(nullptr) {} }; std::unique_ptr<node> head; node * tail; ///< Tail always points to a terminal node std::mutex headMu, tailMu; // Invariant: always lock head before tail if locking both std::condition_variable dataCond; node* getTail() { std::scoped_lock lk(tailMu); return tail; }
public: ThreadQueue() : head(std::make_unique<node>()) { tail = head.get(); } template<typename U> void push_front(U&& data) { auto new_node = std::make_unique<node>( std::make_unique<T>(std::forward<U>(data))); // allocation doesn't need a lock // perform it before getting lock // new_node can't be const so we can move it { std::scoped_lock lk(headMu); new_node->next = std::move(head); head = std::move(new_node); } dataCond.notify_one(); // notifty condition variable after lock unlocks } template<typename U> void push_back(U&& data) { auto new_data = std::make_unique<T>(std::forward<U>(data)); auto next_node = std::make_unique<node>(); { std::scoped_lock lk(tailMu); tail->data = std::move(new_data); tail->next = std::move(next_node); tail = tail->next.get(); } dataCond.notify_one(); } std::optional<std::unique_ptr<T>> pop_front() { std::scoped_lock lk(headMu); if (head.get() != getTail()) { const std::optional<std::unique_ptr<T>> out = { std::move(head->data) }; head = std::move(head->next); // new head is not nullptr because we know head != tail return out; } // due to invariant, if head is tail, then queue is empty return {}; } std::unique_ptr<T> wait_pop() { std::unique_lock head_lk(headMu); dataCond.wait(head_lk, [this]() { return head.get() != getTail(); }); // will not wait if head.get() != tail // head != tail here auto data = std::move(head->data); head = std::move(head->next); return *data; } bool empty() const { std::scoped_lock lk(headMu); return head.get() == getTail(); }
}; For operations requiring both head and tail locks, we must enforce an order in which to lock them. I chose to always lock the head before locking the tail. We create a getTail helper to not forget to lock the tail when doing tail-head comparisons to check emptiness. This class has an invariant that tail always points to a terminal (next pointer is null) node. Therefore, when head.get() == tail, the queue is empty. Also remember: things we want to move cannot be declared const. Move construction/assignment mutates the variable that we move from. Therefore, many of these variables are declared auto even though it may appear that they should be const auto. Also notice that push_front() doesn't modify the existing head node. This allows two threads to push to the front and back of the queue simultaneously. push_front() adds a new head node, keeping the existing one as is, and push_back() modifies the current terminal node. So even when head.get() == tail, the two operations can occur at the same time.

