A lot of times tests will need to share data or logic. In that case we can use a test fixture. A test fixture is a class derived from testing::Test. Any protected members will be available in all tests that use the fixture. It can provide a default constructor/destructor or override the members SetUp() and TearDown() to provide initialization and cleanup logic for any shared data. The constructor and SetUp() are called before each test and the destructor and TearDown() is called after each one. When I say "shared data", I don't mean that the actual instances of each member are shared, but rather each test has its own instance of the same members. Internally, the TEST macro creates a class that is a subtype of Test. We can create a test fixture and use the macro TEST_F to create a test that subtypes this custom fixture. The first argument to TEST_F is the test fixture name, and the second argument is the name of the test. class RingbufferFixture : public testing::Test {
protected: std::unique_ptr<Ringbuffer<int>> r1, r2; void SetUp() override { r1 = std::make_unique<Ringbuffer<int>>(10); r2 = std::make_unique<Ringbuffer<int>>(10); r2.push_back(10); r2.push_back(20); r2.push_back(30); } void r2Add(std::initializer_list<int> elems) { for (e : elems) { r2.push_back(e); } }
}; TEST_F(RingbufferFixture, startEmpty) { ASSERT_TRUE(r1.empty());
} TEST_F(RingbufferFixture, pushChangesSize) { ASSERT_EQ(r2.size(), 3);
} TEST_F(RingbufferFixture, maxSizeUpheld) { r2Add({1, 2, 3, 4, 4, 5, 5, 7, 8, 9}); ASSERT_EQ(r2.size(), 10);
} TEST_F(RingbufferFixture, basicIndex) { ASSERT_EQ(r2[0], 10); ASSERT_EQ(r2[1], 20); ASSERT_EQ(r2[2], 30); r2Add({40, 50, 60}); ASSERT_EQ(r2[3], 40); ASSERT_EQ(r2[4], 50); ASSERT_EQ(r2[5], 60);
} TEST_F(RingbufferFixture, loopingTest) { ASSERT_EQ(r2[0], 10); ASSERT_EQ(r2[1], 20); ASSERT_EQ(r2[2], 30); r2Add({40, 50, 60, 70, 80, 90, 100, 200, 300}); ASSERT_EQ(r2[0], 100); ASSERT_EQ(r2[1], 200); ASSERT_EQ(r2[2], 300);
}

