Right now, if we wanted to do randomized or repeated testing on different inputs, we'd need to use loops in a single test. That's not too bad, but it can get hard to debug what input caused the test to fail. More annoyingly, it would require us to write a loop in all test cases we'd want to repeat on different inputs. Luckily, we can use parameterized tests. First, we create a test fixture which inherits from ::testing::TestWithParam<T> where T is the type of the input. If we need multiple inputs we can make T a tuple. Then we define our tests similar to the test fixture but with the TEST_P macro. class ParameterizedRBFixture : public ::testing::TestWithParam<int> {
protected: const int startingSize = 10; Ringbuffer<int> rb{startingSize}; }; TEST_P(ParameterizedRBFixture, pushTest) { const int param = GetParam(); // get param to test rb.push_back(param); ASSERT_EQ(rb[0], param);
} TEST_P(ParameterizedRBFixture, pushSizeTest) { const int param = GetParam(); for(auto i = 0; i < param; ++i) { rb.push_back(i); } ASSERT_EQ(rb.size(), std::min(param, startingSize));
} INSTANTIATE_TEST_CASE_P(RingBufferTests, ParameterizedRBFixture, testing::Values(1, 711, 1989, 2013));
// Calls ALL tests of the fixture with the specified values // instead of specifying values by a parameter pack, we can also use
// testing::ValuesIn() which generates values from an array, container, or begin and end iterator int vals[] = {4, 56, 70, 0, 100, 230}; INSTANTIATE_TEST_CASE_P(RingBufferTests, ParameterizedRBFixture, testing::ValuesIn(vals)); // Using an iterator for randomized testing: class UniformIntGenerator { std::mt19937 generator {std::random_device{}()}; std::uniform_int_distribution<int> random{0, 2}; uint64_t maxCount, curCount; constexpr static uint64_t finished = ~0; int val;
