GMock provides the ability to mock implementations. For example let's say that you are testing some logic which performs some operation on data received fromm a database. To keep tests fast, and the logic verifiable, it's probably useful to have a mock database which you can control. What we can do is create a database gateway : an interface that abstracts away the concrete database implementation. Then we can have a concrete production class, and a second concrete mock class acts like a real database. Gmock makes developing such a class much easier by providing macros to generate method implementations and assert passed parameters and calling conditions (ex. how many times the function is called, when it's called, etc.). The googletest github repo contains both gtest and gmock. So the only thing we need to do to use gmock is add gmock to the target_link_libraries call for our test in CMake. target_link_libraries(Test PRIVATE GTest::gtest_main PRIVATE GTest::gmock) Then in our test file we can include <gmock/gmock.h>. We can mock methods of a class (we cannot mock free functions) with the MOCK_METHOD macro which takes the method return type, name, arguments surrounded by parentheses, and optionally and qualifiers surrounded by parentheses such as const, noexcept, and override. Ref qualifiers and calling convention can also be specified in this parameter by surrounding the qualifier in ref() and Calltype(), respectively. Mock methods must always be public. class MyMock {
public: MOCK_METHOD(std::string, getName, (), (const)); // std::string getName() const; MOCK_METHOD(int, mult, (int, int), (const, noexcept)); // int mult(int, int) const; MOCK_METHOD(void, setAge, (int)); // void setAge(int);
}; In a test, we can use the EXPECT_CALL macro to assert that a method gets called, use matchers to assert conditions about the passed arguments, and use actions and cardinalities to control the behavior of the mocked method. The first argument to EXPECT_CALL is an instance of a mock class, the second argument is the name of the method that should be called and matchers surrounded by parentheses. The nth matcher in the parentheses applies to the nth argument of the method call. We discussed matchers in the last chapter, but one matcher we haven't discussed is testing::_ which is a matcher that matches anything. using namespace testing;
TEST(MockTest, sqrtCalled) { MyMock mock; EXPECT_CALL(mock, mult(_, AnyOf(Eq(10), Gt(100)))); // _ indicates the first argument can be anything mock.mult(2, 300); // passes because the second argument is > 100
}

