// let n be the number of times mock.mult is called
// if n <= 3, do action_n
// else do action_4 Return([optional value]) - returns from a void function or returns the passed value ReturnArg<N>() - returns the nth argument to the function (0 based) ReturnRoundRobin(vectorOrInitializerList) - circles through elements in the container, returning each one and moving to the next ReturnRef(variable) - returns reference to variable Throw(exn) - throws exn Assign(&variable, value) - assigns value to variable. Expects a pointer as the first argument SaveArg<N>(pointer) - saves the nth argument to the value pointed to by pointer. DeleteArg<N>() - deletes the nth argument, which should be a pointer SetArgReferee<N>(value) - assigns the nth argument to value. The arg should be a reference Invoke(f) - calls the callable object f with the parameters passed to the function Invoke(objectPointer, member function pointer) InvokeWithoutArgs(f) - invokes a function taking no arguments InvokeArgument<N>(args...) - invokes the nth argument as a callable object passing in args... We can also compose actions as well: DoAll(actions...) - self-explanatory IgnoreResult(action) - ignore the result of an action WithArg<N>(action) - executions action with the nth argument passed WithArgs<N0, N1, N...>(action) More information is available here . So let's mock our class: TEST(MockTest, testActions) { MyMock mock; EXPECT_CALL(mock, mult(_, AnyOf(Eq(10), Gt(100)))) .WillRepeatedly(Invoke([](auto a, auto b) { return a * b; })); // we don't actually need to wrap the callable object in Invoke() const std::initializer_list<std::string> names = { "Molly", "Andrew", "Jimmy", "Julia", "Kathy", "Roger" }; EXPECT_CALL(mock, getName()) .WillRepeatedly(ReturnRoundRobin<std::string>(names)); int prevAge = 0; EXPECT_CALL(mock, setAge(Gt<int&>(prevAge))) // specify that prevAge is passed by reference, could also pass std::ref(prevAge) .WillRepeatedly(SaveArg<0>(&prevAge)); ASSERT_EQ(mock.mult(2, 300), 2 * 300); mock.setAge(1); mock.setAge(2); mock.setAge(4); mock.setAge(10); // mock.setAge(8); // error, 8 is < prevAge ASSERT_THAT(std::vector<std::string> { mock.getName() }, IsSubsetOf(names));
}

