The variables we have seen have automatic lifetimes . This means that when their scope ends, they are popped off the stack. The stack is an area in memory. Each program is allocated its own stack of limited size. When a variable is declared, it is pushed on the stack. When a variable goes out of scope, the variable is destroyed and popped off the stack. Having a stack structure allows variables to be destroyed in the reverse order that they were declared. This allows one variable to depend on another. We may talk more about this later but for now, know that these variables of built-in types we have been working with are pushed on the stack when they are declared and popped off when they go out of scope. So what is this scope I talk about? A scope roughly corresponds to a block, which are delimited by {} pairs. The local scope is the scope of a function; variables in this scope are destroyed when the function returns. The class scope is the scope of class members. Values in this scope are initialized when an instance of the object is created and destroyed when that same instance is destroyed. Finally, the namespace scope is the scope of a namespace. Variables in this scope are destroyed when the program ends. { auto a = 3; // a can be used here } // a goes out of scope here // a cannot be used here class Foo { // start class scope int a;
public: void bar() { // start function scope if (a == 3) { // inner scope for if int c = a * 3; } else { // scope for else // c cannot be accessed here } // c cannot be accessed here } // end function scope }; // end class scope int main() { Foo foo; // Foo.a created here
} // Foo is destroyed here, and so is Foo.a

