Doxygen is a popular tool to generate documentation from the comments we write in code. It can generate HTML, XML, LaTeX, and more. Doxygen recognizes a lot of commenting styles but probably the most popular are three slashes /// and Javadocs style /** */. If using Javadocs, we'll probably want to set JAVADOCS_AUTOBRIEF to true in the configuration file so the first line (or until the first period) is recognized as a brief description. Otherwise, a brief description will require an explicit @brief tag. Documentation comments typically go right before the thing they are documenting. We can put them right after however, if the first character of the comment is <. /// An IO stream to a hardware port
class Port {
protected: std::optional<std::string> lastError; ///< The most recent error since errstr() was called.
public: virtual ~Port() = default; /** * Writes all of data to the port * Provides the basic guarantee * @throw IOException on failure */ virtual void writeAll(const std::vector<std::byte> & data) = 0; /** * Gets the last error and resets the error string * @return the most recent error since the last call to * errstr or empty optional if there has been no error */ std::optional<std::string> errstr() noexcept { const auto err = lastError; lastError.reset(); return err; } /** * Reads at least the specified amount of bytes from the port * Call will block until specified amount of bytes are read * @param bytes the minimum amount of bytes to read * @return data read or empty vector if nothing read. Size will be at least `bytes` * @throw IOException on failure - Basic guarantee */ virtual std::vector<std::byte> read(size_t bytes = 0) = 0;
}; I tend to use /// for short or single line comments and Javadocs for longer ones. I also tend to omit things that I feel are unnecessary or repetitive such as an @param indicator for data in writeAll(). Based on this logic, @param bytes could probably be removed from the spec of read() however I personally would rather slightly verbose comments than slightly ambiguous. Since we're looking at this code, I probably wouldn't have a lastError member as we can get this information to the caller in our IOException. Plus, the comment for lastError is slightly repetitive but this was really more for examples than anything. Doxygen supports markdown in their comments. They also have a large range of special commands denoted with either a \ or @ and then the command name. One such category of these commands are structural commands which allow you to document something separate from its definition. The syntax would be to put the structural command on the first line of the file followed by the name of the thing you are commenting. Structural commands include: \file - comment for file \def - document a #define \var - variable \fn - function \struct \namespace \union \enum /** \file source.cpp
* Doxygen testing
* Detailed Desc
*/ /// \def MAX(a, b)
/// max value of `a` and `b` /// \namespace Utils
/// Contains utility functions #define MAX(a, b) ((a) > (b) ? (a) : (b)) namespace Utils { } Doxygen allows you to group functions under the same comment with member grouping. A group is opened with @{ and closed with @}. This allows you to use one comment for similar functions such as overloads. Groups can also be named using @name (or \name) before the opening bracket. The following example is taken from Doxygen documentation. /** A class. Details */
class Memgrp_Test
{ public: ///@{ /** Same documentation for both members. Details */ void func1InGroup1(); void func2InGroup1(); ///@} /** Function without group. Details. */ void ungroupedFunction(); void func1InGroup2(); protected: void func2InGroup2();
}; /** @name Group2 * Description of group 2. */
///@{
/** Function 2 in group 2. Details. */
void Memgrp_Test::func2InGroup2() {}
/** Function 1 in group 2. Details. */
void Memgrp_Test::func1InGroup2() {}
///@} Doxygen also supports module grouping which puts group members onto separate pages. To do this, first you must create a group by using \defgroup followed by the group label and then a description if desired. Next, we can add definitions to that group by putting \ingroup <group label> in the documentation comment of that member. To avoid repeating this command, you can also put \addtogroup <label> before the opening member group brace (@{) to add everything within that member group to the module group. Finally, you can embed links to another group using the \ref <label name> ["<link text>"] command and specifying an optional string to use as the hyperlink in the comment. /** @defgroup Group1
* Basic Math functions
* @{
*/ int add(int, int);
int sub(int, int);
///@} /// \ingroup Group1
int div(int, int); /// \addtogroup Group1
/// @{
int mul(int, int);
int pow(int, int);
/// @} /// \ref Group1 "Click Me"
void foo(); You can use Latex formulas in comments by enclosing them within \f[ and \f]. This only works for HTML, Latex, and RTF output.

