A reference must have a lifetime that is completely within the lifetime of the object it refers to. Consider the following: std::string & getStr() { const auto msg = "Hello " + std::string("World"); return msg;
} auto& msg2 = getStr();
std::cout << msg2 << "\n"; msg goes out of scope, and its memory is freed at the end of getStr(). Yet we are returning a reference to msg past the end of its lifetime! So msg2 is a dangling reference (or dead reference ) because the data it refers to is invalid. So what's going to happen here? We don't know. Our program might terminate with a memory access violation, it might seem to work and occasionally print garbage, or it might set our computer on fire. It's undefined behavior . If you're compiling on -Werror or /WX the compiler will stop you from doing this. Here's another example: (which won't compile) std::vector<std::string&> lotsOfText; void process() { std::ifstream reader("someFile.txt"); std::string book{ std::istream_iterator<char>(reader), std::istream_iterator<char>()}; // read entire file into book // file could be huge, we don't want to copy that lotsOfText.push_back(book); } void consume(unsigned id) { std::cout << lotsOfText[id] << std::endl; } book goes out of scope at the end of process(). Yet we have no idea when consume() will be called. By that time, the data referred to by the references in lotsOfText will likely have gone out of scope, and consume() will access a dangling reference. In general (and we'll talk about this later) you don't want containers (such as std::vector) to store references. In fact, the compiler won't let you. This doesn't mean you're forced to copy the data however, and we'll see some neat features that deal with this in later chapters. When creating a reference to a variable. The reference must not drop any qualifiers. Qualifiers are things such as const or volatile that qualify the type of the variable. This rule ensures that no const variable has its data mutated out from under it. const auto num = 5;
