The & symbol when it comes before a name can be read as "address of" and * before a name is known as the dereference operator and can be read as "value of". The result of the & operator is an address to the underlying value. An address is just a number, but it cannot be stored in a regular integral type. It must be stored in a pointer. As we saw with references, a pointer does not own the value, it owns a copy of the address which points to the underlying data. Pointers are arithmetic types, and adding or subtracting from them will add or subtract the size of the type that they point to from the address. Unlike references, pointers don't have to be initialized. This is not very safe. At the very least, you should set invalid pointers to nullptr, a value reserved for invalid pointers. Trying to dereference an invalid/dangling/null pointer is undefined behavior . With references, creating such deadly situations is much harder since a reference must always be initialized with a value, and most compilers will stop you from taking a reference beyond the lifetime of the object it refers to in some cases. int num = 5;
