Consider you have a UI class that needs to notify the program logic of events on the UI. You could have the UI directly call methods in different classes that need to be notified of events, but what if you create a new module that needs to listen for UI events? With the current approach, the UI will need to be changed. Instead, let's call the UI a Subject, and the modules that need to notified of changes in the Subject, Observers. class Observer {
public: virtual ~Observer() = default; virtual void notify(const Event & e) = 0;
}; class Subject { std::vector<std::reference_wrapper<Observer>> observers;
public: virtual ~Subject() = default; /// Requires `o` outlive this subject void add_listener(Observer & o) { observers.emplace_back(std::ref(o)); } protected: void notify_all(const Event & e) { for(auto o : observers) { o.get().notify(e); } }
}; class UI : public Subject {}
class Listerner1 : public Observer {}
class Listernr2 : public Observer {} UI ui;
Listener1 one;
Listener2 two;
ui.add_listener(one);
ui.add_listener(two); The Event object is simply an object to encapsulate information about what event was raised. We can expand on this structure by providing a two-way channel so that an Observer could tell the Subject when it's being deleted so that an Observer need not outlive the subject. The Mediator pattern is a special case of the Observer patten when a Subject ony supports one observer listening for events. This observer is called the mediator. An expansion on this structure is publisher/subscriber architecture. In this architecture, the subject would be the publisher, and observers would be the subscribers. Publisher/subscriber architecture typically allows multiple publishers. Events are typically published on a message channel, which is an intermediary module, process, or program that sends the messages to the subscribers. Publisher/subscriber architecture is basically the Observer pattern but along a stronger boundary. While Observer is typically implemented to have different modules communicate, publisher/subscriber architecture typically facilitates communication of components that are different processes, threads, programs, or even on different machines.

