As we have seen, if functions are not declared and defined separately, we can use auto to have the compiler use type deduction on the return type. Otherwise, just like function parameters, the return type must be specified. void printHello(); //declaration int main() { printHello(); return 0;
} void printHello() { //definition std::cout << "Hello\n";
} Declaring a function ahead of its definition like in the above snippet is known as forward declaring . It allows us to not have to manually ensure that every function is defined in topological order. It basically tells the compiler "hey, I'm going to define this later so if you see this name before you see its definition don't freak out." void is a special type that essentially means there is no type. We can use it for functions that don't return anything. Functions can be pass-by-value or pass-by-reference . When a function is pass-by-value, the function parameter gets copied. When it's pass-by-reference the actual object is not passed to the function, but the address of the object is. void add(int a) { // pass by value (copy data) a += 5; std::cout << a << std::endl;
} void addRef(int & b) { // pass by reference (bind alias to same piece of data) b += 5;
} int main() { auto num = 0; add(num); // num is still 0 but 5 is printed addRef(num); // num is now 5 return 0;
} In add() a new copy of num is created which is called a. a goes out of scope when add() terminates. In addRef(), b binds to num, so b and num share the same object and the same data. In addRef(), b is used as an output parameter because the result of the function is returned in one of its parameters. You should avoid output parameters. This is because when you're looking at the call site of addRef(), there's nothing to tell you that num is mutated, and you may reasonably expect that num would retain its value. Does that mean we shouldn't pass by reference? No! Far from it. We can pass by const reference. int addRef2(const int & a) { // a += 4; // error, a cannot be mutated return a + 5;
} int main() { auto num = 0; num = addRef2(num); // num is now 5 // from just looking at this, it's pretty clear num is changing
} In this example, you can look at the call site of addRef2() and pretty clearly see that num is being mutated. For built-in types, passing by reference is likely tantamount to premature pessimization. On a 32-bit OS, and address will be 4 bytes, and a 64-bit OS will have 8-byte addresses. Therefore, there would be less data being copied if we just passed by value since an address is at best the same size as an integer (in almost all implementations, but not necessarily). However, we will soon see how this is very useful.

