State is a pattern to help implement FSM (finite state machines) by encapsulating each FSM node with an object. Each FSM state object would implement an abstract state interface. Behavior is then controlled by the FSM delegating actions to the abstract state interface. The concrete class receiving these delegated function calls changes depending on the current state of the FSM. State transitions in the FSM would be implemented by changing the concrete state implementation behind the interface. Take a Window class for example. A window can be open, minimized, maximized, and closed. Depending on the current window state, behavior of the minimize, maximize, and close buttons changes. Each of these three can be a concrete window state class. The state class will handle behavior of the operations, as well as state transitions to other states. class Window { class WindowState { public: virtual ~WindowState() = default; virtual void maximize() = 0; virtual void minimize() = 0; virtual void close() = 0; protected: Window * context; explicit WindowState(Window * wind) : context(wind) {} void transition(std::unique_ptr<WindowState> && newState) { context->state = std::move(newState); } }; std::unique_ptr<WindowState> state; public: Window() { state = std::make_unique<MaxWindowState>(this); } void maximize() { state->maximize(); } void minimize() { state->minimize(); } void close() { state->close(); } }; class MaxWindowState : public WindowState {
public: explicit MaxWindowState(Window * ctx) : WindowState(ctx) {} void maximize() override {} void minimize() override { context->// minimize transition(std::make_unique<MinWindowState>(context)); } void close() override { // ... transition(std::make_unique<CloseWindowState>(context)); }
}; class MinWindowState : public WindowState { public: explicit MinWindowState(Window * ctx) : WindowState(ctx) {} void maximize() override { // ... transition(std::make_unique<MaxWindowState>(context)); } void minimize() override {} void close() override {} }; class CloseWindowState : public WindowState {
public: explicit CloseWindowState(Window * ctx) : WindowState(ctx) {} void maximize() override {} void minimize() override {} void close() override {}
}; A naive approach to implementing a state machine could be to use an enum to represent the current state, and use switch statements to control behavior based on the current state. This can work, however if, like above, the state transition depends on both the input and current state, then we'd have nested switch statements in every method! Not only is that a lot of code duplication, it's super ugly and takes a lot of space.

