The goal of a visitor is to cut down on switches when behavior depends on 2 or more factors. When applying the visitor pattern, we typically have two hierarchies: a hierarchy of nodes and visitors. A node accepts a visitor. Using these two hierarchies, we can have unique behavior for each node-visitor combination. Consider we have three credit card classes, normal, business, and gold. Now also consider we have three types of purchases: services, consumer goods, and capital goods. We want each credit card and purchase type combination to have different discounts. Let's use the Visitor pattern to do this in an OOP way that avoids nested switches or nested if sequences. // Node heirarchy
class CreditCard {
public: ~CreditCard() = default; // visitor accept function virtual double getPurchaseDiscount(const PurchaseType & p, int amount) = 0;
}; class RegularCard : public CreditCard {
public: double getPurchaseDiscount(const PurchaseType & p, int amount) override { return p.visitRegular(this, amount); };
}; class BusinessCard : public CreditCard {
public: double getPurchaseDiscount(const PurchaseType & p, int amount) override { return p.visitBusiness(this, amount); };
}; class GoldCard : public CreditCard {
public: double getPurchaseDiscount(const PurchaseType & p, int amount) override { return p.visitGold(this, amount); };
}; // Visitor heirarchy
class PurchaseType {
public: virtual ~PurhcaseType() = default; virtual double visitRegular(RegularCard * card, int amount) = 0; virtual double visitBusiness(BusinessCard * card, int amount) = 0; virtual double visitGold(GoldCard * card, int amount) = 0;
}; class ServicePurhace : public PurchaseType {
public: double visitRegular(RegularCard * card, int amount) override { return 0; } double visitBusiness(BusinessCard * card, int amount) override { return std::min(amount * 0.001, 0.25); } double visitGold(GoldCard * card, int amount) override { return 0.08; }
}; class ConsumerPurhace : public PurchaseType {
public: double visitRegular(RegularCard * card, int amount) override { return 0.001; } double visitBusiness(BusinessCard * card, int amount) override { return 0; } double visitGold(GoldCard * card, int amount) override { return 0.15; }
}; class CapitalPurhace : public PurchaseType {
public: double visitRegular(RegularCard * card, int amount) override { return 0; } double visitBusiness(BusinessCard * card, int amount) override { return std::min(amount * 0.001, 0.8); } double visitGold(GoldCard * card, int amount) override { return 0.05; }
}; A concrete visitor visits a concrete node. The concrete node calls the corresponding visitor method. The visitor method then performs the computation. This computation can depend on both the Visitor's type, and the Node's type.

