Let's say we had a complicated algorithm that spanned multiple steps like in our computer vision example. As a reminder, we filtered the image, applied a Hough Transform, then used a neural network. What if we wanted to run this algorithm on an embedded device, and change our algorithm to take less memory? We can make this algorithm a template method, and make each step of the algorithm a virtual function so subclasses can customize the behavior. class OCR { virtual cv::Mat filter(const cv::Mat & img) = 0; virtual std::vector<Lines> findLines(const cv::Mat & img) = 0; virtual std::string ocrStep(std::vector<cv::Mat> characterImages) = 0;
public: virtual ~OCR() = default; // this is the template method std::string operator()(const cv::Mat & img) { const auto filtered = filter(img); const auto lines = findLines(filtered); // ... // compute line intersections return ocrStep(intersectionImages); }
}; Subclasses can now customize the function. This function is known as a template method. The parts of the algorithm that don't change are kept in a base class and hooks for customization are provided to subclasses. This pattern basically applies the Open-Close Principle to customize a computation. In C++, it's also quite similar to the NVI idiom.

