A singleton prevents multiple instances of itself from being created. This can be used in situations where it doesn't make sense to have multiple instances of a module such as a Logger class. It does this by making its constructor private, and only allowing access to the instance via a static method. Singleton's can also have lazy initialization. That means they don't create an instance until it's actually used during execution of the static get method. This pattern must be used carefully. While a Singleton is slightly better than globals, the Singleton itself is still a global object of sorts. In C++, the order of initialization and de-initialized between global and static data is undefined. Therefore, if we use Singleton A in the destructor of singleton B, it's possible that when B is destroyed, the static data of A has already been deleted leaving us with undefined behavior. Here's a simple example (that does not deal with the aforementioned dead reference problem) class LoggerSingleton { LoggerSingleton() = default; // private constructor
public: static const LoggerSingleton & get() { static LoggerSingleton singleton; // only created once in first call to get return singleton; } void log(std::string_view str) { // ... } }; LoggerSingleton::get().log("Algorithm started!"); A singleton can also use smart pointers too. class LoggerSingleton { LoggerSingleton() = default; // private constructor static std::unique_ptr<LoggerSingleton> logger;
public: static const LoggerSingleton & get() { if (!logger) { logger = std::unique_ptr(new LoggerSingleton()); // cannot use make_unique because // the constructor is private } return *logger.get(); } void log(std::string_view str) { // ... } }; LoggerSingleton::get().log("Algorithm started!");

