This is a pattern for abstracting data access. Truthfully, I think using the term "Repository Design Pattern" just makes us sound smart, but in reality this pattern boils down to the good old adage: "program to an interface, not an implementation." Instead of using a database directly, the repository abstracts the data behind an interface. This allows us to have different implementations of the repository. This is especially important for testing. Abstracting data access being a repository allows us to have a mock database implementation. Uncle Bob refers to this as a Gateway. class DataRepository {
public: virtual ~DataRepository() = default; virtual void save(std::string key, std::string value) = 0; virtual std::optional<std::string> read(std::string_view key) = 0;
}; class SQLiteRepo : public DataRepository {};
class MockRepo : public DataRepository {};
class RemoteSQLRepo : public DataRepository {}; The repository now forces us to separate business logic from data access logic. Code that needs a database doesn't know or care what kind of database it's using. This allows us to change databases, mock databases, and more without changing a single line of existing code. This pattern is from Martin Fowler's Patterns of Enterprise Application Architecture .

