The first rule of functions is that they should be small. The second rule of functions is that they should be smaller than that [1] Making functions small organizes sections of your code into named units. It's easy to know what your code does when it's part of a named function with a narrow scope. So how small is small? Well most should rarely hit 20 lines. A good rule of thumb is 80 characters wide by 20 lines long or smaller. Not only are small functions easier to reason about and debug, but such functions are readable for most ways in which you might be viewing it. For example, when developing on a PC with your code fullscreened on a 27" monitor, it's pretty easy to read lines of code over 150 character long. However, if you want to do a side-by-side diff comparison, work on the codebase from your 15" laptop with, or have other developers who might use a "busier" IDE layout, those 150 character lines become quite annoying. Vertical size is less annoying to deal with, but it's still quite nice when you can view an entire function in one glance without scrolling on various different viewing modes. Furthermore, functions should do one thing . How do you know they do one thing? Well you should be able to describe it in about one sentence without using a conjunction like "and." Example: if(person.getAge() >= 18 && person.getAge() < 25 && person.getHighestEdu() == EducationLevel::Highschool && !person.livingAtHome()) { // if person attended college after HS
} OR inline auto didAttendCollegeAfterHS(const Person & person) { return person.getAge() >= 18 && person.getAge() < 25 && person.getHighestEdu() == EducationLevel::Highschool && !person.livingAtHome();
} // ... if(didAttendCollegeAfterHS(person)) { } Notice how by creating a helper function, we were able to encode the comment in a name. Commenting what the code does is unnecessary since the function name says it all. If you find yourself commenting what code does, that's a good hint that you might want to make a function. We also see how didAttendCollegeAfterHS() does just one thing: it just determines if a person attended college after high school. We also pass by const reference since the function only uses accessors of Person and doesn't do any mutations. When passing by reference, the reference should always be const unless you are mutating it. For another example, we saw in our guessing game how we turned this: int main() { const auto secretNum = getRandNumBetween(min_value, max_value); auto guess = 0; do { std::cout << "Guess a number between " << min_value << " and " << max_value << std::endl; guess = getUserGuess(); if (guess < secretNum) { std::cout << "Too low!" << std::endl; } else if (guess > secretNum) { std::cout << "Too high!" << std::endl; } } while (guess != secretNum);
} into this int main() { const auto secretNum = getRandNumBetween(min_value, max_value); auto guess = 0; auto tries = 0; do { ++tries; guess = getUserGuess(); displayGuessHint(guess, secretNum); } while (guess != secretNum); displayWin(secretNum, tries);
} Once again, we see that the different tasks done during the main loop are easier to read since they essentially have labelled names. We could be more pedantic and make the loop its own function as well, but this function is 10 lines long, so I felt that was good enough. I like functions to be of a size so that in one "eye-space" I can take in the entire function. So no scrolling, moving my head, etc. Functions should also not use output parameters, and have a small amount of arguments. Generally shoot for no more than 4 arguments. Also, if you have parameters of the same type next to each other (and order matters), you can encode the order in the function name or separate the parameters by some argument of a different type (if there are more arguments). Ex. void assertExpEqAct(int expected, int actual); vs void assertEquals(int expected, int actual); A user of assertExpEqAct() wouldn't have to look up the order of arguments in the docs since the order is encoded right into the name. Here's another example: using it = std::vector<char>::iterator;
void copy(it dstBegin, it dstEnd, it srcBegin, it srcEnd); vs using it = std::vector<char>::iterator;
struct Range { it begin, end;
} void copyDstFromSrc(Range dst, Range src); Notice how the first function was missing an abstraction which led to having 4 parameters. In the second function, we created a struct to organize the parameters into an abstraction. In C++20, this can be done with ranges and std::span. We should also prefer pure functions ; a pure function has no side effects, and returns the same output for the same inputs. It should not mutate variables or have any other effect other than the value it returns.

