Earlier you saw me use the inline keyword. This keyword suggests to the compiler that the function can be inlined. What is an inlined function? Well, we'll cover the details later, but basically every time you call a function the state of the current function must be saved, you must jump to the new function, then you must restore the state of the old function and jump back. Abstractly, this process can be viewed as having to push an activation record onto the stack and then popping it off. An activation record basically contains all the data like arguments being passed, where the function is called from (so it can jump back), and the state of the callee. Sounds like a complex task? Well it sort of is. When a function is inlined, the compiler puts the body of the function right at the call site. So all this jumping and state saving doesn't need to occur. Let's look at another example of factoring out some code into an inline function: constexpr auto expFac = 0.83;
const auto pts = (person.getAge() * person.getGPA() + expFac * person.getName().size()) * year; VS inline auto getExperience(const Person & person) { constexpr auto expFac = 0.83; return person.getAge() * person.getGPA() + expFac * person.getName().size();
} const auto pts = getExperience(person) * year; For most compilers, the generated machine instructions will be pretty much the exact same, but the second option gives us greater readability. A function can only be inlined if it is defined and declared in the same place. So an inline function cannot have separate declarations and definitions unless the declaration and definition are in the same file.

