#include <vector>
using namespace InferenceEngine;
class NeuralNetwork { Core ieCore; ExecutableNeuralNetwork net; std::string modelPath;
public: SemanticSegmentationNetwork(const char * model, const char * device = "CPU"); std::vector<float> infer(const std::vector<float> & input);
}; Firstly, every client of this code is going to end up including string, vector and OpenVino's ie_core.h. Since std::string and std::vector are part of the standard library, they're not really an issue. But clients shouldn't know or care about the implementation of NeuralNetwork and they shouldn't need to depend on the ie_core.hpp header file since they never directly use it. However, the above implementation will include headers from OpenVino for anything that uses a NeuralNetwork. Now, if we decide to update our version of OpenVino and there is a change to ie_core.hpp (which may also include other header files) we'll have to recompile everything that uses the NeuralNetwork interface even though the changes to the library only affect the implementation of NeuralNetwork. We can ameliorate some of these issues by forward declaring the OpenVino classes we use. Instantiating a template or an object of a class requires that class's definition. But declaring the signature of functions that accept/return a forward declared type (known as an incomplete type) or declaring (but not initializing) variables of a forward declared type is legal. #include <vector>
#include <string>
