namespace InferenceEngine { class Core; class ExecutableNeuralNetwork;
} class NeuralNetwork { InferenceEngine::Core ieCore; InferenceEngine::ExecutableNeuralNetwork net; std::string modelPath; class MyClass myClass; // can forward declare type and declare member in one line too
public: SemanticSegmentationNetwork(const char * model, const char * device = "CPU"); ~SemanticSegmentationNetwork(); std::vector<float> infer(const std::vector<float> & input); }; With this method, we no longer are able to define the default constructors and destructors in the header file. This is because at the time the class is defined, Core and ExecutableNeuralNetwork don't have definitions. So the compiler has no idea how exactly to destroy or create these members. Instead, we must declare the destructor in the header file, and define it separately in the source file after the compiler has definitions for all the class's members. This is an improvement, but clients still have visibility of NeuralNetwork's internals. While access modifiers prevent client code from using internal members, it can do nothing to stop clients from knowing it exists. Private members participate in name lookup even if they are encapsulated away. Furthermore, a client using this class that comes to the header file to read documentation is fully exposed to all private and protected data members. They could also see any implementor comments that correspond to internal members. We can create a compiler firewall and improve encapsulation with the pimpl idiom ( p ointer to impl ementation). In the header file: #include <memory>
