} MyClass NeuralNetwork::doIt(const MyClass &) { //..
} C has "true" encapsulation. Foo.h struct Foo * foo_make(); int foo_getSomething(struct Foo *); void foo_doSomething(struct Foo *, int); void foo_free(Foo *); Foo.c struct Foo { int bar;
}; struct Foo * foo_make() { Foo * ptr = (Foo*)malloc(sizeof(Foo)); ptr->bar = 0; return ptr;
} int foo_getSomething(struct Foo * foo) { return foo->bar;
} void foo_doSomething(struct Foo * foo, int a) { foo->bar = a;
} void foo_free(Foo * ptr) { free(ptr);
