The emplace series of member functions (emplace(), emplace_back(), emplace_front(), etc.) allows constructing an element directly in the container rather than copying one. The arguments of an emplace function are forwarded to the constructor. Therefore, any series of arguments that can be used in a constructor to construct a new object that the container holds can be passed to an emplace function. This also includes the move constructor. Therefore emplace should be used to move an element into the container rather than copy it. This allows us to have containers of move-only types such as std::unique_ptr. We'll discuss how this works later. struct MyStruct { int a, b, c; MyStruct(int a, int b, int c) : a(a), b(b), c(c) {}
}; std::vector<MyStruct> structs; structs.emplace_back(5, 20, 30);
// construct a new MyStruct with a = 5, b = 20, and c = 30 onto the back of structs
structs[0].c; // 30 MyStruct s2 = {0, 0, 0};
structs.emplace_back(std::move(s2));
// move s2 into the container by using the move constructor MyStruct s3 = {1, 1, 1};
structs.push_back(s3); // copy s3 into the container
s3.a; //1 - s3 was copied so it's still valid to use

