#include <iostream>
#include <random>
#include <string> constexpr auto min_value = 0;
constexpr auto max_value = 100; auto getRandNumBetween(int min, int max) { std::random_device rd; std::mt19937 generator(rd()); std::uniform_int_distribution distrib(min, max); return distrib(generator);
} /** * @return the number input by the user * @throw std::invalid_argument if the user doesn't type a number */
auto getUserInput() { std::string guessStr; std::getline(std::cin, guessStr); return std::stoi(guessStr);
} auto printNonNumMsg() { std::cout << "You may only guess integers." << std::endl; std::cout << "Please guess again:" << std::endl;
}
/** * Prompts the user for an integer */
auto promptGuess() { std::cout << "Guess a number between " << min_value << " and " << max_value << std::endl;
}
/** * Gets a user's guess. Continues to prompt for a number if the * user does not type a number */
auto getUserGuess() { try { promptGuess(); return getUserInput(); } catch (const std::invalid_argument & exn) { printNonNumMsg(); return getUserGuess(); }
}
/** * Displays a hint based on the user guess * @param actual the real number */
auto displayGuessHint(int guess, int actual) { if (guess < actual) { std::cout << "Too low!" << std::endl; } else if (guess > actual) { std::cout << "Too high!" << std::endl; }
} /** * Tells the user they guessed num correctly * @param num the correct number * @param tries the amount of tries to guess correctly */
auto displayWin(int num, int tries) { std::cout << "Congrats! You guessed " << num << " correctly in " << tries << " tries!\n";
} int main() { const auto secretNum = getRandNumBetween(min_value, max_value); auto guess = 0; auto tries = 0; do { ++tries; guess = getUserGuess(); displayGuessHint(guess, secretNum); } while (guess != secretNum); displayWin(secretNum, tries);
} One thing to note is that we define all of our functions before they are used. This is necessary in C++ because the compiler essentially compiles the code line by line, and it needs to know the definition of things before it sees it in use. It's a good idea to put the function definitions close to where they are going to be called. It's also good to keep functions within about 80 characters wide and 20 lines long. Is this a hard and fast rule? No, far from it but I think it's a nice guideline that can help keep functions short, which is generally accepted as easier to reason about and thus less error prone. Most of a developer's time is spent reading code, so it's worthwhile to put in the effort to make that part of the job easier. Is this over-engineered? Probably. But I really think it's beneficial to start good habits now instead of having to unlearn bad ones later. Something like a Monte Carlo simulation or an algorithm that relies on randomization to be efficient.

