Let's start with the modern array. A C++ array is a fixed-sized container of elements of a fixed type stored contiguously is memory. The size of the array must be known at compile time and cannot change. This because the memory for an array is allocated on the stack statically, so the compiler needs to know how much space to make. While this means that arrays aren't as flexibly as a dynamically sized container, it also means that the memory allocations are much more efficient. std::vector would be your go-to dynamically sized container in C++. Arrays are a class, and part of the STL (standard template library). We'll discuss templates a lot more later, but for now simply think of them as a parameter that can be supplied to classes or functions at compile time. Unlike normal function parameters, template parameters can be, and often are, types. This allows us to create one class for the concept of an array, and instantiate that class on any type we want such as int or std::string or a custom user-defined type. Templates are a big topic we'll discuss later. The interface for the array is declared in the array header and therefore must be included via #include <array>. #include <array> int main() { std::array nums = {1, 2, 3, 4, 5}; nums.size(); //5 nums[0]; //1 nums[4] = 20; for(auto n : nums) { std::cout << n << " "; } // prints "1 2 3 4 5 " return 0;
} We could not declare nums to be auto because by default a list of elements surrounded by braces will be deduced as something else called an std::initializer_list. After nums has been created, we cannot change the size of nums, or the type of elements nums store. In fact, the full definition of nums in reality looks like this: std::array<int, 5> nums = //.... But the compiler is smart enough to deduce the type and size of nums since we initialize it with values. If we did not have the data we want to store in the array at the ready, we would have to specify the size and type to be stored in it. std::array<int, 3> nums;
nums.empty(); // false - array has elements, we just didn't set them
std::array<int, 0> nums2;
num2.empty(); // true std::array<char, 5> letters('a', 'b', 'c', 'd', 'e');
std::array<double, 3> dbls = {3.14, 2.17, 6.28};
const std::array<std::string, 5> names(/*...*/); for(auto n : letters) { // ...
} An array is iterable (more on that later) and therefore we can use an enhanced for-loop to iterate over it. The for loop shown above will go through each element in the array, copy the value into n, and then execute the code in the for loop. This is much less error prone then using the C style indexing loops. If we didn't want to copy the value, we could have declared n to be a reference like so: for(const auto& n : nums). And since we aren't modifying the data, it's good practice to declare the reference const as well. We can also have arrays of arrays as well. std::array<std::array<int, 3>, 3> twoDArray = { {1, 2, 3}, {2, 2, 3}, {3, 2, 3}
}; twoDArray[0][1]; //2
twoDArray.front().front(); //1
twoDArray.back(); // {3, 2, 3}
twoDArray.empty(); // false Why are arrays so limiting? Well the compiler does not dynamically allocate arrays. The memory is allocated on the stack like other variables with automatic lifetimes, which is much more efficient then dynamic allocations. Obviously, there are times when dynamic allocation is necessary and for those times we have the std::vector.

