Stores elements contiguously in memory. The class typically just contains a pointer to the first element and size of the vector. Accessing an invalid index using operator[] is undefined behavior but doing the same using the member function at() with throw an std::out_of_range exception. As we discussed in the last chapter, appending elements to the back of a vector is cheap since capacity grows at a rate of 2x giving us an amortized cost of O(1). Likewise, popping elements off the back or removing a range of contiguous elements that includes the last element is also cheap because the vector can just decrease the value of its size member. It likely won't even free the memory yet because common use cases tell us that it is very likely the user will add more element to the vector. Removing or inserting elements in the middle or beginning of the vector, on the other hand, is quite expensive. The vector will have the move all the elements coming after the insertion/removal point forward or backwards, respectively, the same amount of spaces as elements removed or inserted. As with std::string, you cannot index an element that is off the back of the vector (index >= size()) but still in the allocated area of memory (index < capacity()) because that memory is not necessarily initialized. std::vector<bool> differs greatly from std::vector because it does not adhere to the interface exactly. For space optimization reasons, an std::vector<bool> is basically a dynamic bitset, with each element taking up one bit. Functions like operator[] and at() do not return references to elements anymore, because you cannot take the address of a bit. Instead, they return proxy objects for manipulating the bit at the specified index. // Most containers:
